/*View structure for view vw_ficha_ingreso */

/*!50001 DROP TABLE IF EXISTS `vw_ficha_ingreso` */;
/*!50001 DROP VIEW IF EXISTS `vw_ficha_ingreso` */;

/*!50001 CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `vw_ficha_ingreso` AS (select `f`.`id` AS `id`,`f`.`fecha` AS `fecha`,`f`.`lugar` AS `lugar`,`f`.`edad_adolescente` AS `edad`,`p`.`cedula` AS `cedula`,`p`.`nombres` AS `nombres`,`p`.`apellidos` AS `apellidos`,`f`.`razonIngreso` AS `razonIngreso` from (`sira_fichaingreso` `f` join `sira_persona` `p`) where (`f`.`id_adolescente` = `p`.`id`)) */;

/*View structure for view vw_informe_psicologico */

/*!50001 DROP TABLE IF EXISTS `vw_informe_psicologico` */;
/*!50001 DROP VIEW IF EXISTS `vw_informe_psicologico` */;

/*!50001 CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `vw_informe_psicologico` AS (select `i`.`id` AS `id`,`i`.`fecha` AS `fechaInforme`,`t`.`fecha` AS `fechaTest`,`p`.`cedula` AS `cedula`,concat(`p`.`nombres`,_utf8' ',`p`.`apellidos`) AS `adolescente`,concat(`e`.`nombres`,_utf8' ',`e`.`apellidos`) AS `evaluador`,`f`.`lugar` AS `lugar`,`f`.`edad_adolescente` AS `edad`,`f`.`estado_civil` AS `estadoCivil`,`f`.`nivel_educativo_tipo` AS `nivelInstruccion`,`f`.`razonIngreso` AS `motivoIngreso`,`i`.`impresioesDiagnosticasPsicologo` AS `resultadoTest` from ((((`htp_inf_psicologico` `i` join `sira_fichaingreso` `f`) join `htp_test` `t`) join `sira_persona` `p`) join `sira_persona` `e`) where ((`i`.`id_ficha` = `f`.`id`) and (`i`.`id_test` = `t`.`id`) and (`i`.`id_adolescente` = `p`.`id`) and (`t`.`id_evaluador` = `e`.`id`))) */;

/*View structure for view vw_ingreso_salida */

/*!50001 DROP TABLE IF EXISTS `vw_ingreso_salida` */;
/*!50001 DROP VIEW IF EXISTS `vw_ingreso_salida` */;

/*!50001 CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`192.168.0.%` SQL SECURITY DEFINER VIEW `vw_ingreso_salida` AS (select `i`.`id` AS `id`,`i`.`fecha` AS `fechaIngreso`,(select `e`.`fecha` AS `fecha` from `sira_fichaegreso` `e` where (`e`.`id_ficha_ingreso` = `i`.`id`)) AS `fechaEgreso`,`p`.`nombres` AS `nombres`,`p`.`apellidos` AS `apellidos`,`i`.`razonIngreso` AS `razonIngreso` from (`sira_fichaingreso` `i` join `sira_persona` `p`) where (`i`.`id_adolescente` = `p`.`id`)) */;

/*View structure for view vw_opcion */

/*!50001 DROP TABLE IF EXISTS `vw_opcion` */;
/*!50001 DROP VIEW IF EXISTS `vw_opcion` */;

/*!50001 CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `vw_opcion` AS (select `o`.`id` AS `id`,`o`.`etiqueta` AS `etiqueta`,`o`.`url` AS `url`,`o`.`titulo` AS `titulo`,`o`.`icono` AS `icono`,`o`.`id_padre` AS `id_padre`,`p`.`id_perfil` AS `id_perfil` from (`seg_opcion` `o` join `seg_opcion_perfil` `p` on((`o`.`id` = `p`.`id_opcion`)))) */;

